import jeans_images from "../images/fitjeans.jpg";
import { Link } from "react-router-dom";

const ProductCard = () => {
  return (
    <div class="card">
      <img
        src={jeans_images}
        class="card-img-top rounded mx-auto d-block m-2"
        alt="img"
        style={{
          maxHeight: "270px",
          maxWidth: "100%",
          width: "auto",
        }}
      />

      <div class="card-body">
        <h5 class="card-title">
          <Link
            to="/product"
            style={{
              textDecoration: "none",
            }}
          >
            Black Jeans
          </Link>
        </h5>
        <p class="card-text">Awesome Looking Black Jean</p>
      </div>
      <div class="card-footer text-center">
        <p>
          <span class="ml-2">
            <b>Price : &#8377;999.00/-</b>
          </span>
        </p>
        <span class="ml-2">Stock :</span>
        <span class="ml-1">100</span>
      </div>
    </div>
  );
};

export default ProductCard;
